import React from 'react';


const UserRow = (props) =>{
    return(
        <tr>
        <th scope="row">{props.users.id}</th>
        <td>Larry</td>
        <td>the Bird</td>
        <td>@twitter</td>
        <td>1</td>
        <td>2</td>
        <td>1</td>
        </tr>
    )
}

export default UserRow;
